import { Component, OnInit } from '@angular/core';
import { AppComponent } from 'src/app/app.component';

@Component({
  selector: "app-home",
  templateUrl: "./home.page.html",
  styleUrls: ["./home.page.scss"],
})
export class HomePage implements OnInit {
  constructor(private comp: AppComponent) {}

  ngOnInit() {
    this.comp.menu();
  }
}
<ion-header>
  <ion-toolbar color="principal">
    <ion-title>Home</ion-title>
    <ion-buttons slot="start">
      <ion-menu-button></ion-menu-button>
    </ion-buttons>
  </ion-toolbar>
</ion-header>


<ion-content class="ion-padding custom-content">

  <ion-button shape="round" color="dark" expand="block" [routerLink]="['/c-especialidad']">
    Ingresar especialidad
  </ion-button>
  <ion-button shape="round" color="dark" expand="block" [routerLink]="['/c-especialidad']">
    Ingresar especialidad
  </ion-button>
  <ion-button shape="round" color="dark" expand="block" [routerLink]="['/doctores']">
    Administar doctores
  </ion-button>
  <ion-button shape="round" color="dark" expand="block" [routerLink]="['/pacientes']">
    Administar pacientes
  </ion-button>

</ion-content>
